import React, { useState } from "react";
import MenuIcon from "@mui/icons-material/Menu";
import Container from "@mui/material/Container";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import "./App.css";
import { CancelSharp } from "@mui/icons-material";
import { Box } from "@mui/system";
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';

export const Headers = () => {
  const [sidebar, setsidebar] = useState(false);
  const ShowsideBar = () => setsidebar(!sidebar);

  const [state, setState] = React.useState({
   
    left: false,
    
  });

  const toggleDrawer = (anchor, open) => (event) => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
      return;
    }

    setState({ ...state, [anchor]: open });
  };

  const list = (anchor) => (
    <Box
      sx={{ width: anchor === 'top' || anchor === 'bottom' ? 'auto' : 250 }}
      role="presentation"
      onClick={toggleDrawer(anchor, false)}
      onKeyDown={toggleDrawer(anchor, false)}
    >
      <List>
        {['Inbox', 'Starred', 'Send email', 'Drafts'].map((text, index) => (
          <ListItem key={text} disablePadding>
            <ListItemButton>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
      <Divider />
      <List>
        {['All mail', 'Trash', 'Spam'].map((text, index) => (
          <ListItem key={text} disablePadding>
            <ListItemButton>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItemButton>
          </ListItem>
        ))}
      </List>
    </Box>
  );

  return (<>

<div>
      {[<MenuIcon/>].map((anchor) => (
        <React.Fragment key={anchor}>
          <Button onClick={toggleDrawer(anchor, true)}>{anchor}</Button>
          <Drawer
            anchor={anchor}
            open={state[anchor]}
            onClose={toggleDrawer(anchor, false)}
          >
            {list(anchor)}
          </Drawer>
        </React.Fragment>
      ))}
    </div>

    
    <Container>
      {/* <div className="hidden md:block"> */}
      <div className="h1tag flex justify-between items-center ">
        <h1 className="lg:text-4xl font-bold pt-3 md:text-3xl sm:text-2xl text-2xl">
          The Logo
        </h1>
        <div
          className="header bg-[#DDE8FE] lg:flex items-center gap-6 lg:pt-10 lg:pb-4 lg:px-8 lg:rounded-b-2xl text-[#20416E] lg:text-sm font-bold md:pb-4 md:flex md:px-4 md:pt-8 md:text-xs md:leading-loose md:rounded-b-2xl sm:flex  sm:pt-4 sm:text-xs sm:gap-5 sm:p-4 sm:rounded-b-2xl"
          style={{ boxShadow: "0px 4px 4px 0px #00000040" }}
        >
             <div className="underline cursor-pointer">HOME </div>
          <div className="cursor-pointer">PLACEMENT STATISTICS</div>
          <div className="cursor-pointer">CONTACT US</div>
          <Button variant="outlined" color="secondary">
            RESUME BUILDER
          </Button>
          <div className="icon lg:hidden md:hidden sm:hidden">
            <IconButton>
              {sidebar ? (
                <CancelSharp  onClick={ShowsideBar} /> ) :(
                  <MenuIcon onClick={ShowsideBar} />
                )
              }
              
            </IconButton>
          </div>

        
          
          
        </div>
      </div>
      {/* </div> */}
      <div className="hidden">
        <div className="nav-menu flex items-center justify-between h-24 bg-blue-200 ">
          <div className=" ">
            <h1 className="lg:text-2xl lg:font-bold lg:ml-4 md:text-2xl md:font-bold  md:ml-4  ">
              The Logo
            </h1>
          </div>
          <div className="mr-4">
            {/* {
              <IconButton>
                {sidebar ? (
                  <CancelSharp onClick={ShowsideBar} />
                ) : (
                  <MenuIcon onClick={ShowsideBar} />
                )}
              </IconButton>
            } */}
          </div>
        </div>

        {sidebar ? (
          <aside className=" z-50 w-64" aria-label="Sidebar">
            <div className="overflow-y-auto py-4 px-3 bg-gray-50 rounded dark:bg-gray-800">
              <ul className="space-y-2">
                <li>
                  <a
                    href="#"
                    className="flex items-center p-2 text-base font-normal text-gray-900 rounded-lg dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700"
                  >
                    <svg
                      aria-hidden="true"
                      className="w-6 h-6 text-gray-500 transition duration-75 dark:text-gray-400 group-hover:text-gray-900 dark:group-hover:text-white"
                      fill="currentColor"
                      viewBox="0 0 20 20"
                      xmlns="http://www.w3.org/2000/svg"
                    ></svg>
                    <span className="ml-3 font-semibold">HOME</span>
                  </a>
                </li>
                <li>
                  <a
                    href="#"
                    className="flex items-center p-2 text-base font-normal text-gray-900 rounded-lg dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700"
                  >
                    <svg
                      aria-hidden="true"
                      className="flex-shrink-0 w-6 h-6 text-gray-500 transition duration-75 dark:text-gray-400 group-hover:text-gray-900 dark:group-hover:text-white"
                      fill="currentColor"
                      viewBox="0 0 20 20"
                      xmlns="http://www.w3.org/2000/svg"
                    ></svg>
                    <span className="flex-1 ml-3 whitespace-nowrap font-semibold ">
                      PLACEMENT STATISTICS
                    </span>
                  </a>
                </li>
                <li>
                  <a
                    href="#"
                    className="flex items-center p-2 text-base font-normal text-gray-900 rounded-lg dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700"
                  >
                    <svg
                      aria-hidden="true"
                      className="flex-shrink-0 w-6 h-6 text-gray-500 transition duration-75 dark:text-gray-400 group-hover:text-gray-900 dark:group-hover:text-white"
                      fill="currentColor"
                      viewBox="0 0 20 20"
                      xmlns="http://www.w3.org/2000/svg"
                    ></svg>
                    <span className="flex-1 ml-3 whitespace-nowrap font-semibold">
                      RESUME BUILDER
                    </span>
                  </a>
                </li>
                <li>
                  <a
                    href="#"
                    className="flex items-center p-2 text-base font-normal text-gray-900 rounded-lg dark:text-white hover:bg-gray-100 dark:hover:bg-gray-700"
                  >
                    <svg
                      aria-hidden="true"
                      className="flex-shrink-0 w-6 h-6 text-gray-500 transition duration-75 dark:text-gray-400 group-hover:text-gray-900 dark:group-hover:text-white"
                      fill="currentColor"
                      viewBox="0 0 20 20"
                      xmlns="http://www.w3.org/2000/svg"
                    ></svg>
                    <Button variant="outlined" color="secondary">
                      RESUME BUILDER
                    </Button>
                  </a>
                </li>
              </ul>
            </div>
          </aside>
        ) : null}
      </div>
      {/* </div> */}
    </Container>
    </>
  );
};
